import React from 'react';

class Profile extends React.Component{
    constructor(){
        super();
        this.state={}
    }


    render(){
        return(
            <div className="card">
                <h3 className="text-center" ><span style={{borderBottom:"solid 3px orange"}}>Profile Information</span></h3>
                <table class="table table-responsive">
                <tbody>
                    <tr class="table-success">
                    <th scope="row" colSpan="6">1</th>
                    <td>Mark</td>
                    </tr>
                    <tr class="table-success">
                    <th scope="row">2</th>
                    <td>Jacob</td>
                    </tr>
                    <tr class="table-success">
                    <th scope="row">3</th>
                    <td>Larry</td>
                    </tr>
                </tbody>
                </table>
            </div>
        );
    }
}

export default Profile;
